import React, { Component } from "react";
import { fetchUserRentals } from "../../actions/";
import { connect } from "react-redux";

class RentalManage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      userRentals: [],
      errors: []
    };
  }

  componentDidMount() {
    this.props
      .fetchUserRentals()
      .then(userRentals => this.setState({ userRentals }))
      .catch(errors => this.setState({ errors }));
  }

  render() {
    const { isAuthenticated } = this.props.auth;
    return <div>{isAuthenticated && <h1>Rental Manage</h1>}</div>;
  }
}

const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(mapStateToProps)(RentalManage);
